import React from 'react';
import logo from '../assets/logo.png'; // Assurez-vous que le chemin est correct

function Interface2({ onNavigate }) {
    const handleBackClick = () => {
        onNavigate('Interface1'); // Navigation vers Interface1 lors du clic sur "Back"
    };

    const onStartClick = () => {
        // Logique pour passer à l'interface suivante
    };

    return (
        <div className="container py-4">
            <NavBar /*progress={33} debit={10} *//> {/* Exemples de valeurs pour la barre de progression et le débit */}
            <div className="mb-3" style={{ cursor: 'pointer', color: 'black' }} onClick={handleBackClick}>
                &lt;Back
            </div>

            <div className="text-center">
                <h2>Combien de personnes utilisent Internet chez vous?</h2>
                <button className="btn btn-primary mx-2" onClick={onStartClick}>1-2</button>
                <button className="btn btn-primary mx-2" onClick={onStartClick}>3-4</button>
                <button className="btn btn-primary mx-2" onClick={onStartClick}>4+</button>
            </div>
        </div>
    );
}

function NavBar(/*{ progress, debit }*/) {
    return (
        <header className="container">
            <div className="row align-items-center justify-content-between py-2">
                <div className="col-auto">
                    <img src={logo} alt="Topnet Logo" style={{ height: '40px' }} />
                </div>
                <div className="col">
                    <ProgressBar /*progress={progress} *//>
                </div>
                <div className="col-auto">
                    <div style={{ fontSize: '20px' }}>25 Mbps</div> {/* Remplacer par la valeur réelle */}
                </div>
            </div>
        </header>
    );
}

function ProgressBar({ progress }) {
    return (
        <div className="progress" style={{ height: '10px' }}>
            <div className="progress-bar" role="progressbar" style={{ width: `${progress}%`, backgroundColor: '#ff4081' }}></div>
        </div>
    );
}

export default Interface2;
